((document,submitForm)=>{const buttonDataSelector="data-submit-task";const formId="adminForm";const submitTask=task=>{const form=document.getElementById(formId);if(form&&task==="cwmlocation.batch"){submitForm(task,form)}};document.addEventListener("DOMContentLoaded",()=>{const button=document.getElementById("batch-submit-button-id");if(button){button.addEventListener("click",e=>{const task=e.target.getAttribute(buttonDataSelector);submitTask(task);return false})}})})(document,Joomla.submitform);